 import React from 'react';
 import props from 'prop-types'
 import GoodDayMessage from './components/GoodDayMessage'
 import { Box, Card, Image, Heading, Text } from 'rebass'
import './App.css';
import RebassTheme from './components/RebassTheme'

function App() {

  return (
    <div className='App'>
      <h1>Brett Schlereth</h1>
      <GoodDayMessage/>
      <Box/>
    </div>
  )
}

export default App;
